 au peak. Juste avant l’attaque, la victime a été rejoint au peak par un second surfeur qui se trouvait à quelques mètres de distance. Les deux hommes étaient assis sur leurs planches et regardaient vers le large lorsque l’attaque s’est produite, sans signe avant-coureur. La victime a été happée et maintenue au fond par un requin qui, en position verticale, battait de la queue en surface.\n\nUne fois remontée en surface, la victime a été prise en charge par le deuxième surfeur présent qui a nagé vers lui pour tenter de le ramener au bord. Alors qu’ils nageaient en direction de la côte, une vague puissante a déferlé et séparé les deux hommes. La victime ayant perdu connaissance, elle a rapidement dérivé et a été emportée par un courant puissant vers le Nord. \n\nLes tentatives de récupération du corps de la victime par les surfeurs présents sur site ont été vaines. \n\nLes services de secours ont été appelés vers 16h35. Le corps de la victime a pu être récupéré par la cellule nautique des pompiers avec l’appui d’un hélicoptère peu après.','-21.163351254648134,55.284932208906696','200','La Gauche','2019-05-09 12:30:00','2.50','Réunion','Attaque','Bouledogue','Houle significative de 3,6m, vent de force 5 à 6, faible couverture nuageuse, et visibilité réduite avec une eau chargée en particules sur lieu de l\'attaque.','Saint-Leu ',13,_binary '',_binary '',3,'1.0','09/05/2019 16:30',_binary '\0','Réunion','-20.9333,55.4167',NULL),(3031,'Dans l’après-midi, jusqu’à 6 personnes ont été présentes sur le spot de la gauche de Saint Leu.\nVers 16h30, 4 personnes étaient à l’eau au moment de l’attaque : 3 surfeurs et 1 kayakiste.\n2 personnes se trouvaient au bowl, deux autres au peak. Juste avant l’attaque, la victime a été rejoint au peak par un second surfeur qui se trouvait à quelques mètres de distance. Les deux hommes étaient assis sur leurs planches et regardaient vers le large lorsque l’attaque s’est produite, sans signe avant-coureur. La victime a été happée et maintenue au fond par un requin qui, en position verticale, battait de la queue en surface.\n\nUne fois remontée en surface, la victime a été prise en charge par le deuxième surfeur présent qui a nagé vers lui pour tenter de le ramener au bord. Alors qu’ils nageaient en direction de la côte, une vague puissante a déferlé et séparé les deux hommes. La victime ayant perdu connaissance, elle a rapidement dérivé et a été emportée par un courant puissant vers le Nord. \n\nLes tentatives de récupération du corps de la victime par les surfeurs présents sur site ont été vaines. \n\nLes services de secours ont été appelés vers 16h35. Le corps de la victime a pu être récupéré par la cellule nautique des pompiers avec l’appui d’un hélicoptère peu après.','-21.163242586707838,55.28497139683819','200','Leu - La Gauche','2019-05-09 12:30:00','2.50','Réunion','Attaque','Bouledogue','Houle significative de 3.6m, vent de force 5 à 6, une turbidité moyenne avec une eau chargée en particules et une visibilité plus réduite sur le lieu de l\'attaque','Saint',13,_binary '',_binary '',3,'1.0','09/05/2019 16:30',_binary '\0','Réunion',NULL,NULL),(3032,'D’après les témoignages recueillis sur site, la victime se trouvait au moment de l’attaque dans une faible hauteur d’eau, en position debout, et à moins de 5m du bord.\nElle venait de se mettre à l’eau depuis très peu de temps et était seule dans l’eau. Après l’attaque, la victime a été immédiatement secourue par d’autres pêcheurs présents sur site.\nLa pêche pratiquée par la victime consiste à pêcher les bichiques sur le front de mer avant que les alevins ne trouvent l’embouchure de la rivière la plus proche (Rivière de l’Est). Selon les pêcheurs interviewés sur site, cette pratique est connue pour être risquée car les alevins attirent des prédateurs et une faune sous-marine associée potentiellement attractive pour des requins.','-21.107664145847068,55.77270648738795','5','Le Butor (St Benoît)','2019-01-30 05:30:00','2.40','Réunion','Attaque','